import React from 'react';

const Card = ({ card }) => {
    return (
        <div className="card">
            <div className="card-title">
                <span>{card.title}</span>
            </div>
            <div className="card-details">
                <p>{card.description}</p>
            </div>
        </div>
    );
};

export default Card;
